import React, { useState } from 'react';
import { connect } from 'react-redux';
import Page from '../../components/page/Page';
import updateIcon from '../../imgs/icons/updateIcon.png';
import listIcon from '../../imgs/icons/list.png';

import './Profile.scss';

const Profile = () => {
    //detaisl | form
    const [currentTab, setCurrentTab] = useState('details');
    return (
        <Page>
            <nav aria-label="Profile's submenu" className='submenu'>
                <ul aria-label="Profile's submenu links">
                    <li className='submenu__link'>
                        <button
                            onClick={() => {
                                setCurrentTab('details');
                            }}
                        >
                            <img
                                src={listIcon}
                                className='submenu__icon'
                                alt=''
                            />
                            Details
                        </button>
                    </li>
                    <li className='submenu__link'>
                        <button
                            onClick={() => {
                                setCurrentTab('form');
                            }}
                        >
                            <img
                                src={updateIcon}
                                className='submenu__icon'
                                alt=''
                            />
                            Update Profile
                        </button>
                    </li>
                </ul>
            </nav>
        </Page>
    );
};

export default Profile;
